svg.script:
let isPaused = false;
let shellVisible = true;
let heaterCoreTripleHelixVisible = true;
const svg = document.querySelector('svg');

function toggleRotation() {
  isPaused = !isPaused;
  const pauseBtn = document.getElementById('pauseBtn');
  const resumeBtn = document.getElementById('resumeBtn');

  if (isPaused) {
    svg.pauseAnimations();
    pauseBtn.style.display = 'none';
    resumeBtn.style.display = 'block';
  } else {
    svg.unpauseAnimations();
    pauseBtn.style.display = 'block';
    resumeBtn.style.display = 'none';
  }
}

function toggleShell() {
  shellVisible = !shellVisible;
  const shellParts = ['backShell', 'frontShell', 'shellEdgeLeft', 'shellEdgeRight', 'shellHighlightLeft', 'shellHighlightRight'];
  const btn = document.getElementById('shellBtn');
  const btnText = btn.querySelector('text');

  shellParts.forEach(id => {
    const element = document.getElementById(id);
    if (element) {
      element.style.display = shellVisible ? 'block' : 'none';
    }
  });

  btnText.textContent = shellVisible ? 'HIDE SHELL' : 'SHOW SHELL';
}

function toggleHeaterCoreTripleHelix() {
  heaterCoreTripleHelixVisible = !heaterCoreTripleHelixVisible;
  const heaterCore = document.getElementById('heaterCoreInTripleHelix');
  const btn = document.getElementById('heaterCoreTripleHelixBtn');
  const btnText = btn.querySelector('text');

  if (heaterCore) {
    heaterCore.style.display = heaterCoreTripleHelixVisible ? 'block' : 'none';
  }

  btnText.textContent = heaterCoreTripleHelixVisible ? 'HIDE CORE' : 'SHOW CORE';
}
